import React from "react";
import { Card } from 'hero-design'

export default function DocumentCard({ cardInfor }: { cardInfor: any }) {


    return (
        <Card
            key={cardInfor.id}
            id={cardInfor.id}
            variant={'primary'}
            style={{ width: '15rem', margin: '10px'}}
            imageSrc={cardInfor.path}
        >
            <Card.Header style={{ wordWrap:'break-word', margin: '10px'}}>
                {cardInfor.title}
            </Card.Header>
            <Card.Content style={{ wordWrap:'break-word'}}>
                {
                    cardInfor.description
                }
            </Card.Content>
        </Card>
    )
}
